import React from "react";

const Jobs =()=>{
    const [data, setData] = React.useState(null);

    React.useEffect(() => {
        fetch("/results")
          .then((res) => res.json())
          .then((data) => setData(data.result));
      }, []);
    return(
        <div>
             <p>{!data ? "Loading..." : 
             data.map(job => <div>{job.title}</div>)
             }</p>
        </div>
    )
}
export default Jobs
